
USE [2AM]
GO

if exists (select * from INFORMATION_SCHEMA.TABLES WHERE TABLE_SCHEMA = 'test' and TABLE_NAME = 'BankAccountDetails')
begin
drop table test.BankAccountDetails
End

create table test.BankAccountDetails
(
ACBBankDescription varchar(255),
ACBBranchCode varchar(10),
ACBBranchDescription varchar(255),
AccountNumber varchar(25),
ACBTypeNumber int,
ACBTypeDescription varchar(255),
Status bit)
go

go

Update test.BankAccountDetails Set Status = 1 where AccountNumber in (Select bad.AccountNumber from test.BankAccountDetails bad join
BankAccount ba on bad.AccountNumber = ba.AccountNumber)

